'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendOcoOrderCommand extends SendSingleCommandWithoutResponse {
    entryOrderRequests;
    sides;
    clientRates;
    pointSizes;
    timeController;
    constructor() {
        super();
        this.commandName = "SendOcoOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createOcoOrderRequestMessage(this.tradingSession, this.entryOrderRequests, this.sides, this.clientRates, this.pointSizes, this.requestNumberGenerator, stdlib.nowutc(), this.timeController);
    }
}
module.exports = SendOcoOrderCommand
